import React, { useState } from "react";
import { jsPDF } from "jspdf";

/* ðŸ”µ HEADER & FOOTER IMAGES */
const HEADER_IMAGE = "data:image/png;base64,";
const FOOTER_IMAGE = "data:image/png;base64,";

function App() {
  const questions = [
    {
      id: "q1",
      text: "Which direction do I feel pulled toward in my life right nowâ€”and why?",
      help: "Think about patterns in your attention, emotion, and desire. What keeps resurfacing?"
    },
    {
      id: "q2",
      text: "What do I already have that could help me move forward?",
      help: "Consider skills, relationships, habits, experiences, or internal strengths."
    },
    {
      id: "q3",
      text: "What do I clearly need to develop, change, or let go of?",
      help: "Be honest. Growth requires awareness."
    },
    {
      id: "q4",
      text: "If I keep doing exactly what Iâ€™ve been doing, what does my life look like one year from now?",
      help: "Project realistically, not ideally."
    },
    {
      id: "q5",
      text: "What does â€œhomeâ€ look like to me in this season of life?",
      help: "This may be emotional, relational, spiritual, or physical."
    },
    {
      id: "q6",
      text: "What is the one area I could improve right now that would positively impact every other area?",
      help: "Focus on leverage."
    }
  ];

  const [current, setCurrent] = useState(0);
  const [completed, setCompleted] = useState(false);
  const [error, setError] = useState("");
  const [showHelp, setShowHelp] = useState(false);

  const [formData, setFormData] = useState({
    name: "",
    q1: "",
    q2: "",
    q3: "",
    q4: "",
    q5: "",
    q6: ""
  });

  const progress = Math.round(((current + 1) / questions.length) * 100);

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
    setError("");
  };

  const validateCurrent = () => {
    if (!formData.name.trim()) {
      setError("Student name is required.");
      return false;
    }

    const answer = formData[questions[current].id];
    if (!answer.trim()) {
      setError("Please answer this question before continuing.");
      return false;
    }

    return true;
  };

  const nextQuestion = () => {
    if (!validateCurrent()) return;
    setShowHelp(false);
    setCurrent(current + 1);
  };

  const prevQuestion = () => {
    setError("");
    setShowHelp(false);
    setCurrent(current - 1);
  };

  const generatePDF = () => {
    if (!formData.name.trim()) {
      setError("Student name is required.");
      return;
    }

    for (let q of questions) {
      if (!formData[q.id].trim()) {
        setError("All questions must be answered before downloading.");
        return;
      }
    }

    const doc = new jsPDF();
    const pageWidth = doc.internal.pageSize.getWidth();
    const pageHeight = doc.internal.pageSize.getHeight();

    const addHeaderFooter = () => {
      doc.addImage(HEADER_IMAGE, "PNG", 0, 0, pageWidth, 30);
      doc.addImage(FOOTER_IMAGE, "PNG", 0, pageHeight - 25, pageWidth, 25);
    };

    let y = 45;
    addHeaderFooter();

    doc.setFont("times", "normal");
    doc.setFontSize(12);

    doc.text(`Student Name: ${formData.name}`, 20, y);
    y += 8;

    doc.text(`Submission Date: ${new Date().toLocaleString()}`, 20, y);
    y += 15;

    questions.forEach((q, index) => {
      if (y > pageHeight - 40) {
        doc.addPage();
        addHeaderFooter();
        y = 45;
      }

      doc.setFont(undefined, "bold");
      doc.text(`${index + 1}. ${q.text}`, 20, y);
      y += 8;

      doc.setFont(undefined, "normal");
      const splitText = doc.splitTextToSize(formData[q.id], 170);
      doc.text(splitText, 20, y);
      y += splitText.length * 7 + 15;
    });

    const safeName = formData.name
      .trim()
      .replace(/[^a-zA-Z0-9 ]/g, "");

    doc.save(`Section 2 - ${safeName}.pdf`);

    setCompleted(true);
  };

  if (completed) {
    return (
      <div style={styles.page}>
        <div style={styles.container}>
          <h2 style={{ color: "#0f766e" }}>
            Your PDF Has Been Downloaded
          </h2>

          <p>
            Now go to the bottom of this page and upload the document
            in the Assignment Submission Box.
          </p>

          <button
            style={styles.retryButton}
            onClick={generatePDF}
          >
            Click Here to Retry Download
          </button>
        </div>
      </div>
    );
  }

  return (
    <div style={styles.page}>
      <div style={styles.container}>
        <h1 style={{ color: "#0f766e" }}>Section Two</h1>
        <h2 style={{ color: "#334155" }}>
          Direction, Resources, and Truth</h2>
<h3 style={{ color: "#334155" }}>  
          Please make sure to click the "Start Assignment" button before answering the questions. 
        </h3>

        {/* Progress Bar */}
        <div style={styles.progressWrapper}>
          <div
            style={{
              ...styles.progressBar,
              width: `${progress}%`
            }}
          />
        </div>
        <p style={{ textAlign: "right", fontSize: 12 }}>
          {progress}% Complete
        </p>

        {current === 0 && (
          <input
            type="text"
            name="name"
            placeholder="Student Name"
            value={formData.name}
            onChange={handleChange}
            style={styles.input}
          />
        )}

        <div key={current} style={{ animation: "fadeSlide 0.4s ease" }}>
          <div style={styles.questionHeader}>
            <h3>
              Question {current + 1} of {questions.length}
            </h3>

            <span
              style={styles.helpIcon}
              onClick={() => setShowHelp(!showHelp)}
            >
              ?
            </span>
          </div>

          {showHelp && (
            <div style={styles.helpBox}>
              {questions[current].help}
            </div>
          )}

          <p>{questions[current].text}</p>

          <textarea
            name={questions[current].id}
            value={formData[questions[current].id]}
            onChange={handleChange}
            rows="7"
            style={styles.textarea}
          />

          {error && <p style={styles.error}>{error}</p>}
        </div>

        <div style={styles.nav}>
          {current > 0 && (
            <button
              onClick={prevQuestion}
              style={styles.secondaryButton}
            >
              Previous
            </button>
          )}

          {current < questions.length - 1 ? (
            <button
              onClick={nextQuestion}
              style={styles.primaryButton}
            >
              Next
            </button>
          ) : (
            <button
              onClick={generatePDF}
              style={styles.primaryButton}
            >
              Download My Answers
            </button>
          )}
        </div>

        <style>
          {`
            @keyframes fadeSlide {
              from { opacity: 0; transform: translateX(20px); }
              to { opacity: 1; transform: translateX(0); }
            }
          `}
        </style>
      </div>
    </div>
  );
}

const styles = {
  page: {
    minHeight: "100vh",
    backgroundColor: "#f1f5f9",
    padding: "60px 20px",
    fontFamily: "Georgia, serif"
  },
  container: {
    maxWidth: "800px",
    margin: "0 auto",
    backgroundColor: "white",
    padding: "40px",
    borderRadius: "16px",
    boxShadow: "0 15px 40px rgba(0,0,0,0.08)"
  },
  progressWrapper: {
    height: "6px",
    backgroundColor: "#e2e8f0",
    borderRadius: "4px",
    marginBottom: "10px"
  },
  progressBar: {
    height: "100%",
    backgroundColor: "#0f766e",
    transition: "width 0.4s ease"
  },
  input: {
    width: "100%",
    padding: "10px",
    marginBottom: "20px",
    borderRadius: "6px",
    border: "1px solid #ccc"
  },
  textarea: {
    width: "100%",
    padding: "12px",
    borderRadius: "6px",
    border: "1px solid #ccc"
  },
  questionHeader: {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center"
  },
  helpIcon: {
    cursor: "pointer",
    backgroundColor: "#f59e0b",
    color: "white",
    width: "28px",
    height: "28px",
    borderRadius: "50%",
    textAlign: "center",
    lineHeight: "28px",
    fontWeight: "bold"
  },
  helpBox: {
    backgroundColor: "#fef3c7",
    padding: "12px",
    borderRadius: "6px",
    marginBottom: "10px"
  },
  nav: {
    display: "flex",
    justifyContent: "space-between",
    marginTop: "20px"
  },
  primaryButton: {
    backgroundColor: "#0f766e",
    color: "white",
    padding: "10px 20px",
    borderRadius: "8px",
    border: "none",
    cursor: "pointer"
  },
  secondaryButton: {
    backgroundColor: "#6366f1",
    color: "white",
    padding: "10px 20px",
    borderRadius: "8px",
    border: "none",
    cursor: "pointer"
  },
  retryButton: {
    marginTop: "20px",
    backgroundColor: "#f97316",
    color: "white",
    padding: "10px 20px",
    borderRadius: "8px",
    border: "none",
    cursor: "pointer"
  },
  error: {
    color: "red",
    marginTop: "10px"
  }
};

export default App;
